import Crumbs from "../Crumbs/Crumbs";
import Header from "../Header/Header";
import Catalog from "../Catalog/Catalog";
import MobileNavBar from "../MobileNavBar/MobileNavBar";
import Tags from "../Tags/Tags";


export default function CatalogPage({ onCardClick, onLikeClick, products, setProducts, savedProducts, isLoggedIn, terms, onCatClick, category, tags, onTagClick, onBurgerClick, onBurgerClose, isBurgerOpen, search, setSearch, orders, cart, sortBy, setSortBy, sortOrder, setSortOrder, fetchProducts, productFilters, setProductFilters }) {

  // const location = useLocation();
  // const queryParams = new URLSearchParams(location.search);

  // access query parameters
  // const paramValue = queryParams.get("paramName");

  return (
    <>
    {/* <Crumbs/> */}
    <Tags 
      terms={terms} 
      tags={terms.tags} 
      categories={terms.categories} 
      onTagClick={onTagClick}
      activeCategory={category}
      activeTags={tags}
      sortBy={sortBy}
      setSortBy={setSortBy}
      sortOrder={sortOrder}
      setSortOrder={setSortOrder}
      productFilters={productFilters}
      setProductFilters={setProductFilters}
    />
    <Catalog
      onCardClick={onCardClick}
      onLikeClick={onLikeClick}
      products={products}
      setProducts={setProducts}
      savedProducts={savedProducts}
      isLoggedIn={isLoggedIn}
      fetchProducts={fetchProducts}
      productFilters={productFilters}
    />
    <MobileNavBar 
    onBurger={onBurgerClick} 
    isBurgerOpen={isBurgerOpen} 
    onBurgerClose={onBurgerClose}
    cart={cart}
    orders={orders}/>
    </>
  )
}
